import "./navbar.css";
import { Link } from "react-router-dom";

const navbar = () => {
  return (
    <div>
      <div className="row">
        <div className="col ">
          <Link to="/" className="mx-2">
            Home
          </Link>
          <Link to="/signin" className="mx-2">
            Signin
          </Link>
        </div>
      </div>
    </div>
  );
};

export default navbar;
